export const drawFunction = (ctx: CanvasRenderingContext2D) => {
  ctx.fillStyle = 'red';
  ctx.fillRect(0, 0, 100, 100);
};

interface candleToDraw {
  open: number;
  high: number;
  low: number;
  close: number;
  indicators: {
    revBar: 'buy' | 'sell';
    fractal: 'up' | 'down';
    alligator: {
      jaw: number;
      teeth: number;
      lips: number;
    };
  };
}

interface CandleCanvas {
  width: number;
  height: number;
  min: number;
  max: number;
}

class Candle2D {
  open: number;
  close: number;
  low: number;
  high: number;

  constructor(open: number, close: number, low: number, high: number, min) {
    this.open = open;
    this.close = close;
    this.low = low;
    this.high = high;
  }
}
